import React from "react";

function AddFishForm() {
  createFish = (event) => {
    event.preventDefault();
  };

  return (
    <form className="fish-edit" onSubmit={this.createFish}>
      <input ref="name" name="name" type="text" placeholder="Name" />
      <input ref="price" name="price" type="text" placeholder="Price" />
      <select ref="status" name="status" type="text" placeholder="Status">
        <option value="available">Fresh</option>
        <option value="unavailable">Sold Out</option>
      </select>
      <textarea
        ref="desc"
        name="desc"
        type="text"
        placeholder="Desc"
      ></textarea>
      <input ref="image" name="image" type="text" placeholder="Image" />
      <button type="submit">Add Fish</button>
    </form>
  );
}

export default AddFishForm;
